    false,nt"url": null,nt"notes": "This narrative report for Seney National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1958. The report begins by summarizing the weather conditions, water conditions,
    habitat conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    reptiles, fish, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, vegetation
    control, and wildfires. Resource management is outlined; topics include fur harvesting
    and timber removal. A progress report on field investigations and applied research
    is included. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, fishing, and violations. N-R forms
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
